            <ul>
    <nav class="navbar bg-body-tertiary">
    <form class="container-fluid justify-content-start">

    <button class="btn btn-outline-success me-2" type="button">글목록</button>
    <button class="btn btn-outline-success me-2" type="button">글쓰기</button>

    </form>
    </nav>

            </ul>

    );
};

export default Navigation;
